INSERT INTO `yss_content` (`id`, `specific_name`, `page`, `position`, `layout`, `title`, `detail`, `pic`, `pic_title`, `lang`, `sort_order`, `date_create`, `date_update`) VALUES
	(4, '0', 4, 'section1', 'RIGHT_PIC', 'YSS สู่ความเชื่อมั่นทีมงาน R&D', '<p>YSS ผู้ผลิตและพัฒนาโช้คอัพรถยนต์และรถมอเตอร์ไซค์มากว่า 30 ปี โดยใช้เทคโนโลยีและอุปกรณ์ที่ทันสมัย มีการพัฒนาและปรับปรุงผลิตภัณฑ์อย่างต่อเนื่อง ทำให้ในทุกขั้นตอนของการผลิตมีคุณภาพสูง พร้อมทั้งมีทีมงาน R&D มากประสบการณ์จากยุโรปที่พัฒนาโช้คอัพเพื่อใช้ในการแข่งขันในรายการระดับโลกมาอย่างมากมาย คอยมุ่งมั่นพัฒนาสินค้า และบุคลากรของเราอย่างต่อเนื่อง ทำให้สินค้าทุกชิ้นมีคุณภาพทัดเทียมยุโรป รวมถึงขั้นตอนการนำโช้คอัพไปทดสอบประสิทธิภาพการใช้งาน การติดตั้ง ความทนทานและความปลอดภัยทีม R&D ใส่ใจในทุกขั้นตอนทำให้คุณภาพสินค้าของ</p>\r\n\r\n<p>YSS ได้รับการรับรองมาตรฐานสินค้า จากสถาบัน Kraftfahrt-Bundesamt (KBA)- Federal Motor Transport Authority จากประเทศเยอรมัน ซึ่งเป็นแบรนด์เดียวในเอเซียที่ผ่านการรับรองนี้ และผ่านการทดสอบมาตรฐานสินค้า ABE จากประเทศเยอรมัน นอกจากนี้ สินค้าของ YSS ผ่านมาตรฐานอุตสาหกรรมยานยนต์มากมาย เช่น  QS9000, ISO/TS16949, ISO9001 จาก TUV RHEILAND รวมถึงเทคโนโลยที่คิดค้นขึ้นเองอย่าง VVSC,VBSC อีกด้วย</p>', '20151028075433.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'TH', 1, '2015-10-28 07:54:33', '2015-10-30 07:10:29'),
	(5, '0', 4, 'section1', 'RIGHT_PIC', 'YSS team confidence to R & D.', '<p>YSS is a shock absorber manufacturer for cars and motorcycles for more than 30 years. YSS continues using advanced technology and equipment at all stages of the production to develop and improve high quality of products continuously. Also, YSS has R & D team from Europe that has a lot of experience for developing shock absorber in order to compete in the global wide. All products made with quality equivalent to European quality including the shock absorber performance, installation, durability, and safety testing. R & D team cares every step to make YSS products to meet customer satisfaction. <p>\r\n\r\n<p>YSS received certification from the Institute Kraftfahrt-Bundesamt (KBA) - Federal Motor Transport Authority of Germany which is the only brand in ASEAN that has been certified. Additionally, YSS was certified in various automotive industries such as QS9000, ISO / TS16949, ISO9001 from TUV RHEILAND.</p>', '20151028080016.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 1, '2015-10-28 08:00:16', '2015-10-30 07:16:26'),
	(6, '0', 4, 'section2', 'LEFT_PIC', '', 'YSS ยังปลูกฝังจิตสำนึกให้พนักงานในองค์กร ใส่ใจในการรักษาสิ่งแวดล้อมทั้งภายใน และภายนอกชุมชนพร้อมกับปรัชญาในการผลิตโช้คอัพที่ว่า “เราต้องคิดอยู่เสมอว่า เรากำลังผลิตโช้คอัพให้กับตัวเองและครอบครัว”', '20151028083510.jpg', '“เราต้องคิดอยู่เสมอว่า เรากำลังผลิตโช้คอัพให้กับตัวเองและครอบครัว”', 'TH', 2, '2015-10-28 08:35:10', '2015-10-30 07:11:57'),
	(7, '0', 4, 'section2', 'LEFT_PIC', '', 'YSS is also cultivate all staffs awareness to pay attention to the environment both internal and external communities with its philosophy of producing a shock absorber that "We have always thought that we are producing a shock absorber to myself and my family”.', '20151028083831.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 2, '2015-10-28 08:38:31', '2015-10-30 07:15:25'),
	(8, '0', 6, 'section1', 'RIGHT_PIC', 'คุณภาพระดับโลก', 'Shock you can trust. Our shocks have met ABE product standard from Germany and are produced in the process certified under ISO 9001.', '20151028085711.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'TH', 1, '2015-10-28 08:57:11', '2015-10-30 06:09:21'),
	(9, '0', 6, 'section1', 'RIGHT_PIC', 'World Class Quality', 'Shock you can trust. Our shocks have met ABE product standard from Germany and are produced in the process certified under ISO 9001.', '20151028085821.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 1, '2015-10-28 08:58:21', '2015-10-30 09:07:53'),
	(10, '0', 7, 'section1', 'TOP_PIC', 'ความรับผิดชอบต่อสังคม', 'บริษัท วาย.เอส.เอส (ประเทศไทย) จำกัด ได้ตระหนักถึงความสำคัญในการอยู่ร่วมกันของคนในสังคม และบริษัทได้มีกิจกรรมสนับสนุนและพัฒนาชุมชนทั้งทางด้านการศึกษา การร่วมแรงร่วมใจในการทำความสะอาดชุมชน การรณรงค์ต้านยาเสพติด ฯลฯ ซึ่งได้รับความร่วมมือของคนในชุมชนเป็นอย่างดี', '20151028091632.jpg', 'มอบทุนการศึกษาให้นักเรียน', 'TH', 1, '2015-10-28 09:16:32', '2015-10-30 08:59:13'),
	(11, '0', 7, 'section1', 'TOP_PIC', 'Corporate Social Responsibility', 'Corporate Social Responsibility', '20151028092418.jpg', 'Corporate Social Responsibility', 'EN', 1, '2015-10-28 09:24:18', '2015-10-30 08:59:38'),
	(12, 'intro-vision', 5, 'section1', 'RIGHT_PIC', 'วิสัยทัศน์', 'YSS ผู้ผลิตและพัฒนาโช้คอัพรถมอเตร์ไซค์และรถยนต์ที่เปี่ยมไปด้วยคุณภาพระดับโลก ด้วยเทคโนโลยีที่มีประสิทธิภาพสูง สร้างความคุ้มค่าสำหรับลูกค้า\r\n\r\n<p>\r\n<h2>พันธกิจ</h2>\r\nYSS ผู้ผลิตโช้คอัพรถมอเตอร์ไซต์และรถยนต์ที่มีคุณภาพสูงโดยใช้เทคโนโลยีและอุปกรณ์ที่ทันสมัย พร้อมทีมงานมืออาชีพ           ที่ผ่านการฝึกอบรมเป็นอย่างดี มีศูนย์ Service Center ที่คอยให้บริการแก่ลูกค้า สร้างความมั่นใจว่าโช้คอัพ YSS เป็นโช้คอัพระดับโลกอย่างแท้จริง\r\n</p>\r\n', '20151103041135.jpg', 'We serve the world, We provide the best', 'TH', 1, '2015-10-28 09:43:50', '2015-11-03 04:35:19'),
	(13, 'intro-history', 5, 'section1', 'RIGHT_PIC', 'VISION', 'We are the leadership in development and manufacturing of world class suspension, continuous innovating quality products with whole of technology, performance and value for our customers.\r\n\r\n<p>\r\n<h2>MISSION</h2>\r\nWe will produce high performance and more value suspension through advance technology and equipment with well-trained full skill and active teams. We also have service centers to provide worldwide customers. Furthermore, we have quality system and social responsibility to ensure that YSS is the world class suspension.\r\n</p>', '20151103044049.jpg', 'We serve the world, We provide the best', 'EN', 1, '2015-10-28 09:44:43', '2015-11-03 04:40:49'),
	(14, 'intro-history', 5, 'section2', 'LEFT_PIC', 'ประวัติความเป็นมา', '<p class="history02">\r\n      <span class="dropcap2">2526</span>\r\n       ก่อตั้งโรงงานขึ้นครั้งแรก อ.พระประแดง จ.สมุทรปราการ\r\n</p>\r\n\r\n<p class="history02">\r\n        <span class="dropcap2">2531</span>\r\n         ธุรกิจเริ่มขยายตัว จึงร่วมทุนกับชาวใต้หวัน ย้ายฐานการผลิตเข้าไปยังนิคมอุตสาหกรรมบางพลี \r\nจ.สมุทรปราการ\r\n</p>\r\n\r\n<p class="history02">\r\n         <span class="dropcap2">2538</span>\r\n        ปรับโครงสร้างองค์กรครั้งใหญ่ โดยคุณภิญโญ พานิชเกษม และกลายเป็นบริษัทคนไทย 100 %\r\n</p>\r\n\r\n<p class="history02">\r\n                  <span class="dropcap2">2540</span>\r\n                  เจาะตลาด เอเซีย ตะวันออกกลาง ยุโรป อาฟริกา และอเมริกาใต้\r\n</p>', '20151103041438.png', 'We produce shock absorber for ourselves and our family', 'TH', 2, '2015-10-28 09:52:18', '2015-11-03 04:36:06'),
	(15, 'intro-history', 5, 'section2', 'LEFT_PIC', 'History', '<p class="history02">\r\n      <span class="dropcap2">1983</span>\r\n      Y.S.S First factory was established in Thailand. \r\n</p>\r\n\r\n<p class="history02">\r\n        <span class="dropcap2">1988</span>\r\n         Taiwanese partners joined us to expand the business and we moved our factory to Bangplee in \r\n      	Samutprakarn, Thailand.\r\n</p>\r\n\r\n<p class="history02">\r\n         <span class="dropcap2">1995</span>\r\n       Become 100% Thai Company and reengineering by Mr.Pinyo Panichgasem\r\n</p>\r\n\r\n<p class="history02">\r\n                  <span class="dropcap2">1997</span>\r\n                  We entered oversea market such as Asia, South America,  Africa, Europe and Middle East.\r\n</p>', '20151103044729.png', 'We produce shock absorber for ourselves and our family', 'EN', 2, '2015-10-28 09:53:25', '2015-11-03 04:47:29'),
	(16, '0', 10, 'section1', 'RIGHT_PIC', 'การติดตั้งโช้คอัพ', 'การติดตั้งโช้คอัพ ท่านสามารถนำรถของท่านเข้ามาทำการติดตั้งโดยผู้ชำนาญงานโดยเฉพาะที่โรงงานของเราได้ทุกวัน จันทร์-ศุกร์ เวลา 9.00 - 18.00 น. หรือสอบถามได้ที่ 02-706-3700,\r\n02-763-8600 ', '20151028101144.jpg', 'ติดตั้งโช้คอัพโดยช่างผู้เชี่ยวชาญ', 'TH', 1, '2015-10-28 10:11:44', '2015-10-30 09:33:19'),
	(17, '0', 10, 'section1', 'RIGHT_PIC', 'Setup & Install', 'Setup & Install detail detail detail detail...', '20151028101308.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 1, '2015-10-28 10:13:08', '2015-10-30 09:31:02'),
	(18, '0', 11, 'section1', 'RIGHT_PIC', 'การรับประกัน', 'รายละเอียดการรับประกันสินค้า', '20151029031052.png', 'บรรยายใต้ภาพ', 'TH', 1, '2015-10-29 03:10:52', '2015-10-30 09:26:54'),
	(19, '0', 11, 'section1', 'RIGHT_PIC', 'Warranty', 'detail detail detail detail detail detail detail detail detail detail detail detail', '20151029031228.png', 'under pic detail', 'EN', 1, '2015-10-29 03:12:28', '2015-10-30 09:27:23'),
	(20, '0', 14, 'section1', 'RIGHT_PIC', 'ซัพพอร์ต', 'รายละเอียดเกี่ยวกับซัพพอร์ต', '20151029051738.jpg', 'คำบรรยายใต้ภาพ', 'TH', 1, '2015-10-29 05:17:38', '2015-10-30 09:32:29'),
	(21, '0', 14, 'section1', 'RIGHT_PIC', 'Support', 'support detail support detail detail detail', '20151029052008.jpg', 'test description', 'EN', 1, '2015-10-29 05:20:08', '2015-10-30 09:31:37'),
	(23, '0', 20, 'section1', 'TOP_PIC', 'Service Center "YSS" make over "smile"', '<span class="dropcap2">YSS</span> is a shock absorber manufacturer for cars and motorcycles for more than 30 years. \r\nYSS continues using advanced technology and equipment at all stages of the production to \r\ndevelop and improve high quality of products continuously. YSS has dealers in more than 30 \r\ncountries around the world to offer the best service with a professional and well-trained Service \r\nCenter team.\r\n', '20151030103219.jpg', 'Service Center', 'EN', 1, '2015-10-30 10:32:19', '2015-10-30 10:37:03'),
	(24, '0', 20, 'section1', 'TOP_PIC', 'Service Center “YSS” ให้มากกว่า“รอยยิ้ม”', '<span class="dropcap2">YSS</span> ผู้ผลิตและพัฒนาโช้คอัพรถมอเตอร์ไซค์มากกว่า 30 ปี ด้วยเทคโนโลยีและอุปกรณ์ที่ทันสมัย  มีการพัฒนาและปรับปรุงผลิตภัณฑ์อย่างต่อเนื่อง YSS ยังมีตัวแทนจำหน่ายมากกว่า 30 ประเทศทั่วโลก   มีศูนย์ Service Center ที่คอยให้บริการแก่ลูกค้าด้วยทีมงานมืออาชีพ และผ่านการฝึกอบรมมาเป็นอย่างดี  โดยให้บริการทั้งในด้านการให้คำแนะนำ กรณีที่ลูกค้านำรถมาซ่อมโช้คอัพหรือติดตั้งโช้คอัพใหม่ มีห้องรับรองเพื่ออำนวยความสะดวกให้แก่ลูกค้าระหว่างรอ มีการทดสอบรถภายหลังจากการซ่อมหรือติดตั้งโช้คอัพเสร็จ รวมถึงมีบริการหลังการขายที่เปี่ยมไปด้วยความจริงใจของพนักงานYSS อีกด้วย ', '20151030103426.jpg', 'Service Center', 'TH', 1, '2015-10-30 10:34:26', '2015-10-30 11:04:18'),
	(25, '0', 20, 'section2', 'RIGHT_PIC', '', 'ทั้งนี้ ศูนย์ Service Center สามารถซ่อมโช้คอัพรถมอเตอร์ไซค์ รถสกูตเตอร์ รถบิ๊กไบท์ และรถUTV โดยมีศูนย์บริการมากถึง 11 ศูนย์ ในต่างประเทศ ส่วนในประเทศไทย มีศูนย์ Service Center อยู่ที่ถนน เทพารักษ์ อ.บางพลี จ.สมุทรปราการ โดยทุกศูนย์ ใช้มาตรฐานเดียวกันเพื่อให้ลูกค้าของ YSS เกิดความประทับใจในงานบริการและเกิดความเชื่อมั่นต่อตัวสินค้า YSS มากขึ้น  ', '20151030110756.jpg', '', 'TH', 2, '2015-10-30 11:06:20', '2015-10-30 11:07:56'),
	(26, '0', 20, 'section2', 'RIGHT_PIC', '', '<p>We provide customer with a complete service in terms of giving advice, repair and install \r\nthe car\'s shock absorber as well as after-sales service to bursting with sincerity of YSS.</p>\r\n\r\n<p>\r\nThe Service Center provide the most professional facility for all kinds of vehicle: Motorbikes, scooters, cars, Big Bike and UTV by a service team up to 11 service centers around the globe. All service centers use the same standard to give YSS customers impression and satisfaction in service and confidence in YSS product.\r\n</p>\r\n', '20151030110944.jpg', '', 'EN', 2, '2015-10-30 11:09:44', NULL),
	(27, 'service_wellcome_txt', 20, 'other', 'ONLY_TEXT', 'Service Center “YSS” ให้มากกว่า“รอยยิ้ม”', 'YSS ผู้ผลิตและพัฒนาโช้คอัพรถมอเตอร์ไซค์มากกว่า 30 ปี ด้วยเทคโนโลยีและอุปกรณ์ที่ทันสมัย    มีการพัฒนาและปรับปรุงผลิตภัณฑ์อย่างต่อเนื่อง YSS ยังมีตัวแทนจำหน่ายมากกว่า 30 ประเทศทั่วโลก   มีศูนย์ Service Center ที่คอยให้บริการแก่ลูกค้าด้วยทีมงานมืออาชีพ และผ่านการฝึกอบรมมาเป็นอย่างดี ', NULL, '', 'TH', NULL, '2015-10-30 11:33:49', NULL),
	(28, 'service_wellcome_txt', 20, 'none', 'ONLY_TEXT', 'Service Center "YSS" make over "smile"', 'YSS is a shock absorber manufacturer for cars and motorcycles for more than 30 years. \r\nYSS continues using advanced technology and equipment at all stages of the production to \r\ndevelop and improve high quality of products continuously. YSS has dealers in more than 30 \r\ncountries around the world to offer the best service with a professional and well-trained Service \r\nCenter team.\r\n', NULL, '', 'EN', NULL, '2015-11-02 02:41:31', '2015-11-02 02:42:16'),
	(29, 'intro-history', 5, 'section3', 'LEFT_PIC', '', '<p class="history02">\r\n                 <span class="dropcap2"> 2544</span>\r\n                 ได้รับมาตรฐาน QS 9000 และ ISO 9002 โดย Tuv Rheinland จากประเทศเยอรมัน\r\n</p>\r\n\r\n<p class="history02">\r\n                  <span class="dropcap2">2546</span>\r\n                  มีสินค้ามากกว่า 300 โมเดล ครอบคลุมรถจักรยานยนต์กว่า 14 ยี่ห้อทั่วโลก\r\n</p>\r\n\r\n<p class="history02">\r\n                  <span class="dropcap2">2547</span>\r\n                เริ่มพัฒนาโช้คแก๊สเป็นครั้งแรกในประเทศไทย\r\n</p>', '20151103041558.png', '', 'TH', 3, '2015-11-03 04:05:49', '2015-11-03 04:37:07'),
	(30, 'intro-history', 5, 'section4', 'LEFT_PIC', '', '<p class="history02">\r\n      <span class="dropcap2">2548</span>\r\n       ร่วมทุนกับทีมวิจัยและพัฒนาจากทวีปยุโรป ในการพัฒนาผลิตภัณฑ์และถ่ายทอดเทคโนโลยี\r\n</p>\r\n\r\n<p class="history02">\r\n        <span class="dropcap2">2549</span>\r\n         ได้รับมาตรฐานอุตสาหกรรมยานยนต์ ISO/TS 16949 โดย Tuv Rheinland จากประเทศเยอรมัน\r\n</p>\r\n\r\n<p class="history02">\r\n         <span class="dropcap2">2550</span>\r\n        ก่อตั้งศูนย์วิจัยและพัฒนา YSS Europe BV. ณ.เมือง ชินเดล ประเทศ ฮอลแลนด์\r\n</p>\r\n\r\n<p class="history02">\r\n                  <span class="dropcap2">2551</span>\r\n                  ฉลองครบรอบ25 ปี พร้อมปรับเปลี่ยน VERSION และแผนระยะ 10 ปี\r\n</p>', '20151103042356.jpg', '', 'TH', 4, '2015-11-03 04:18:43', '2015-11-03 04:23:56'),
	(31, 'intro-history', 5, 'section5', 'LEFT_PIC', '', '<p class="history02">\r\n      <span class="dropcap2">2551</span>\r\n       ได้รับมาตราฐานคุณภาพผลิตภัณฑ์ ABE โดยสถาบันKBA จากประเทศเยอรมันสำหรับโช้คในกลุ่มรถสกุตเตอร์\r\nยี่ห้อแรกในทวีปเอเชีย\r\n</p>\r\n\r\n<p class="history02">\r\n        <span class="dropcap2">2553</span>\r\n        สร้างโรงงานแห่งใหม่ ซึ่งถือเป็นโรงงานผลิตโช้คอัพมอเตอร์ไซค์ภายใต้ Brand ของตัวเอง สำหรับตลาด\r\nอะไหล่ ทดแทนและ Hi Performance\r\n</p>\r\n\r\n<p class="history02">\r\n         <span class="dropcap2">2554</span>\r\n        ได้รับมาตราฐานคุณภาพผลิตภัณฑ์ ABE โดยสถาบันKBA จากประเทศเยอรมันสำหรับโช้คในกลุ่มรถ\r\nมอเตอร์ไซค์ยี่ห้อแรกในทวีปเอเชีย พร้อมพัฒนาโช้คอัพแก๊สในระบบดับเบิ้ลทิวส์ สำหรับมอเตอร์ไซค์เป็นเจ้าแรกของโลก ในชื่อรุ่น HYBRID\r\n</p>\r\n', '20151103042858.png', '', 'TH', 5, '2015-11-03 04:27:42', '2015-11-03 04:32:28'),
	(32, 'intro-history', 5, 'section5', 'LEFT_PIC', '', '<p class="history02">\r\n         <span class="dropcap2">2558</span>\r\n       สร้างโรงงานแห่งที่ 2 บนพื่นที่ใช้สอย 5,000 ตร.ม  ครอบคลุมการผลิตสปริง เพื่อตอบสนองความต้องการของตลาดทั่วโลก \r\n</p>\r\n\r\n<p class="history02">\r\n         <span class="dropcap2">2562</span>\r\n        Y.S.S. จะเป็นที่หนึ่งของตลาดโช้คอัพ High Performance รถมอเตอร์ไซค์ และรถสกูตเตอร์ \r\n</p>', '20151103043112.png', '', 'TH', 5, '2015-11-03 04:31:12', '2015-11-03 04:32:05'),
	(33, 'intro-history', 5, 'section3', 'LEFT_PIC', '', '<p class="history02">\r\n      <span class="dropcap2">2001</span>\r\n      We certified quality system QS9000 and ISO9002 certified by TUV Rheinland,Germany.\r\n</p>\r\n\r\n<p class="history02">\r\n        <span class="dropcap2">2003</span>\r\n       Y.S.S.’s Product ranges over 300 models that compatible with motorbikes more than 15 brands around the world\r\n</p>\r\n\r\n<p class="history02">\r\n         <span class="dropcap2">2004</span>\r\n       Launch gas shock absorber technology.\r\n</p>', '20151103044948.png', '', 'EN', 5, '2015-11-03 04:49:48', '2015-11-03 05:19:05'),
	(34, 'intro-history', 5, 'section4', 'LEFT_PIC', '', '<p class="history02">\r\n                  <span class="dropcap2">2005</span>\r\n                  European R&D team joined YSS to research and develop new technology of shock absorber.\r\n</p>\r\n<p class="history02">\r\n      <span class="dropcap2">2006</span>\r\n      We are certified ISO/TS 16949 by TUV Rheinland,Germany.\r\n</p>\r\n\r\n<p class="history02">\r\n        <span class="dropcap2">2007</span>\r\n    Y.S.S (EUROPE) LTD. was established in Holland as EUROPEAN R&D CENTER.\r\n</p>\r\n\r\n<p class="history02">\r\n         <span class="dropcap2">2008</span>\r\n      We celebrated 25th anniversary and announced a new vision for the next decade.\r\n</p>', '20151103045618.jpg', '', 'EN', 6, '2015-11-03 04:56:18', '2015-11-03 05:19:33'),
	(35, 'intro-history', 5, 'section5', 'LEFT_PIC', '', '<p class="history02">\r\n                  <span class="dropcap2">2008</span>\r\n                Y.S.S. scooter shock absorbers are got ABE by TUV Rheinland under authorization of KBA,Germany. \r\n</p>\r\n\r\n<p class="history02">\r\n      <span class="dropcap2">2010 </span>\r\n      New factory with full of new technology, machine and system to produce high performance shock absorbers for global market.\r\n</p>\r\n\r\n<p class="history02">\r\n        <span class="dropcap2">2011</span>\r\n     Our motorbike shock absorbers are the first brand in Asia that has been certified for national type approval (ABE) by TUV Rheinland under authoeization of KBA, Germany.“Hybrid” the world’s double tube gas shock absorber was launcher.\r\n</p>\r\n', '20151103050610.png', '', 'EN', 7, '2015-11-03 05:03:00', '2015-11-03 05:17:34'),
	(36, 'intro-history', 5, 'other', 'LEFT_PIC', '', '<p class="history02">\r\n         <span class="dropcap2">2015</span>\r\n     2nd Factory with working area : 5,000 Sq.m. Product full ranges of spring for world market\r\n</p>\r\n\r\n<p class="history02">\r\n                  <span class="dropcap2">2019</span>\r\n                 World no.1 of High Performance Shock Absorber for Motorcycle and Scooter \r\n</p>', '20151103051519.png', '', 'EN', 8, '2015-11-03 05:15:19', NULL);
INSERT INTO `yss_feature` (`id`, `feature`, `title`, `description_th`, `description_en`, `remark`) VALUES
	(1, 'P', 'STEP SPRING PRELOAD', 'ปรับความแข็งอ่อนของสปริงแบบขั้นบันได ปรับได้ 5-7 ระดับ', '-', '-'),
	(2, 'T', 'THREAD SPRING PRELOAD', 'ปรับความแข็งของสปริงแบบเกรียว  โดยจะกลึงเกลียวไว้ที่กระบอกโช้คอัพ แล้วสวมตัวปรับลัษณะรูปแหวนหมุนไปตามเกลียวจนกดตัวสปริง แล้วขันน๊อตกันคลาย ซึ่งเป็นน๊อตตัวเล็กหมุนสกรูเข้าจากด้านข้างโดยตรงเพื่อไม่ให้แหวนคลายตัว', '-', '-'),
	(3, 'H', 'HYDRAULIC SPRING  PRELOAD', 'ปรับความแข็งของสปริงแบบไฮดรอลิก จะใช้ชุดตัวปรับไฮโดรลิคไว้ที่กระบอก ปรับสปริงโดยหมุนแกนปรับไปทาง + สปริงจะแข็งขึ้น ถ้าหมุนแกนปรับไปทาง – สปริงจะนุ่มลง', '-', '-'),
	(4, 'H1', 'HYDRAULIC SPRING PRELOAD CABLE', 'ปรับความแข็งของสปริงแบบไฮดรอลิกแบบมีสาย ตัวปรับสปริงไฮโดรลิค แบบมีสายจะใช้ชุดตัวปรับไฮโดรลิคไว้ที่กระบอก ปรับสปริงโดยหมุนแกนปรับไปทาง + สปริงจะแข็งขึ้น ถ้าหมุนแกนปรับไปทาง – สปริงจะนุ่มลง ข้อดีคือ สามารถนำชุดสายไฮโดรลิคไปไว้ในตำแหน่งที่สะดวกต่อการปรับ โดยไม่ต้องลงมาปรับที่ตัวโช้คอัพ', '-', '-'),
	(5, 'R', 'REBOUND ADJUSTABLE', 'เป็นตัวช่วยควบคุมการคืนตัวของโช้คอัพ ให้เร็วหรือช้าได้ตามความต้องการ ออกแบบให้มีตัวปุ่มปรับเข็มควบคุมปริมาณน้ำมันผ่านรูแกน Free Bleed และที่ปุ่มปรับ Rebound ออกแบบให้รู้สึกถึงการปรับได้เวลาหมุนปรับ โดยสามารถปรับได้ 30-60 ระดับ ', '-', '-'),
	(6, 'C', 'COMPRESSION ADJUSTABLE', 'ปรับระดับการยุบตัวมี 2 แบบคือ 3 ระดับและ 30 ระดับ', '-', '-'),
	(7, 'W', 'HIGH-LOW SPEED', 'ปรับช่วงยุบของโช้คแบบ ไฮ-โล สปีด เป็นชุดสุดยอดของการปรับ Compression ที่พัฒนามาจาก Low Speed โดยออกแบบให้มีทางน้ำมันไหลผ่านไปยังปุ่มควบคุมที่เป็นชุดวาล์วที่จดจำการทำงานเมื่อมีแรงดันน้ำมันสูงเกินที่ Low Speed จะรับได้ในจังหวะกดกระแทกอย่างรุนแรง ไม่ทำให้เกิด Hydraulic Lock', '-', '-'),
	(8, 'L', 'LENGTH ADJUSTERABLE', 'ปรับเพิ่มความยาวของโช้คเพิ่มได้อีก 10 มิลลิเมตร ตัวปรับความยาว เป็นตัวที่ช่วยเพิ่มความยาวของโช้คอัพให้มากขึ้น โดยสามารถปรับได้ 2 แบบ คือแบบปรับเพิ่ม 10 มิลลิเมตร หรือแบบปรับความยาวเพิ่มหรือลดได้ 5 มิลลิเมตร ปรับโดยการหมุนเกลียวเข้าหรือออก และล็อคให้แน่นด้วยน๊อต', '-', '-'),
	(9, 'V', 'VBSC HIGH-LOW SPEED COMPRESSION AND OIL BALANCE ADJUSTABLE', 'ด้วยระบบการทำงานสองประสานระหว่าง Hi-Low Speed และ Valve Balance ช่วยลดแรงกดกระแทกขณะเข้าโค้งทุกรูปแบบ โค้งสั้น โค้งยาว และโค้งรูปตัว S ทำให้รถไม่เสียการทรงตัว', '-', '-');
