	(136, 'จักรกฤษ อินอ่อน', 'Chukkrit Inon', 'ชาย', '0000-00-00', 23, 53, 167, '08-3078-7050', 'chukkrit_v10@hotmail.com', '', 0, 0, '', '145/3 บ้านพักรถไฟ กม.11 ถ.วิภาวดี-รังสิต แขวงจตุจักร เขตจตุจักร กรุงเทพมหานคร 10900', '-เคยฝึกงานกับ Miracle Time Travel ได้มีการออกบูธที่เมืองทอง จัดเอกสารสำหรับลูกทัวร์ที่จะออกเดินทาง ตรวจเช็ค Passport ติดต่อสถานที่พัก ออกทริปสัมนาเป็น staff tour <br />\r\n-สอบออกทริปกับทางวิทยาลัย โดยการจัดตั้งบริษัทขึ้นมาภายในวิทยาลัย หาสถานที่เที่ยวที่เป็นที่นิยมในขณะนั้น แล้วเริ่มจากการตั้งชื่อบริษัทแบ่งหน้าที่ให้แต่ละคน เริ่มลงมือออกสำรวจเส้นทางและสถานที่ที่จะนำมาใส่ในโปรแกรมทัวร์ จัดทำใบปลิว ทำภายโฆษณาภายในวิทยาลัยและทำเว็บเพจของบริษัททัวร์ จากนั้นเริ่มทำการจัดโปรแกรมทัวร์ คิดค่าใช้จ่ายต่อคน จากนั้นจัดงานเทศการการท่องเที่ยวที่วิทยาลัยมีการจัดบูธขายทริปที่จะจัด จากนั้นเริ่มมีการเตรียมตัวสำหรับการออกทริป เช่น ของรางวัลในการเล่นเกมส์ อาหารว่าง ป้ายชื่อ ทำประกันให้กับลูกทัวร์ ติดต่อโรงแรม เมื่อถึงวันออกทริปก็คอยตอนรับลูกทัวร์ลงทะเบียนรับแท๊กติดกระเป๋าเดินทาง เมื่อลูกทัวร์มาครบก็ให้ขึ้นรถเริ่มการแนะนำตัวของพนักงานทุกคน ทวนโปรแกรมทัวร์ เริ่มแจกอาหารว่างและเล่นเกมส์แจกของรางวัล แวะตามสถานะที่ท่องเที่ยวต่างๆตามโปรแกรมทัวร์ เมื่อเสร็จสิ้นทริปถึงจุดหมายปลายทางก็กล่าวขอบคุณลูกทัวร์แจกของที่ระลึก ส่งลูกทัวร์ขึ้นรถเดินทางกลับบ้าน สรุปทริป', 'นายประสิทธิ์ อินอ่อน', '08-5607-4178', 'บิดา', '35', '40', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดีมาก', 'พอใช้', 'พอใช้', 'พอใช้', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', '', 'ว่ายน้ำ เรียนภาษาญี่ปุ่น', 'App_761301012.jpg', 'Chukkrit Inon.doc', '124.121.120.251', '2015-08-30 00:00:00'),
