	(194, 'รัตนะ ตันติวาณืชเกียรติ', 'RATANA TANTIWANICHKIAT', 'ชาย', '0000-00-00', 38, 62, 173, '0814888875', 'noomratat@gmail.com', '', 0, 0, '', '6/9 หมู่5 ซอยจินดาเวช หนองแขม กรุงเทพ10160', 'สวัสดีครับผมชื่อ รัตนะ ตันติวาณิชเกียรติ ชื่อเล่น หนุ่ม เป็นคนคล่องแคล่ว ว่องไว แก้ปัญหาเฉพาะหน้าได้ ประสบการณ์ทำงาน ในตำแหน่ง หัวหน้าทัวร์ ไกด์ มีบัตรแพตตินั่มถูกต้อง ประสบการณ์ 13ปี แถบเอเซีย เกาหลี ฮ่องกง จีน มาเลย์ บาหลี ยุโรปบางเส้นทางแต่ไม่ค่อยถนัด ส่วนใหญ่เน้นทางเอเซีย ภูมิลำเนา อยู่ ขุนตาล เชียงราย ทำทั้งทัวร์หน้าร้าน กรุ๊ปเหมาวีไอพี กรุ๊ปดูงาน พรีเซ้นต์กรุ๊ปได้ ขายทัวร์ได้ เนื่องจากงานที่ทำอยู่ต้องออกไปพบลูกค้า เพื่อพรีเซ้นต์กรุ๊ป ออกบูธด้วย ผ่านงานมา2บริษัท คือ บริษัทมาร์โคเวิลด์ ทัวร์ หลานหลวง กทม กับ บริษัทเจอร์นี่แลนด์ (แลนด์เกาหลี) และ ยู สมาย ในส่วนกรุ๊ปหน้าร้าน และกรุ๊ปเหมา สามารถตรวจสอบ ประวัติการทำงานได้ โดยเฉพาะวงการทัวร์เกาหลี พอจะเป็นที่รู้จักอยู่บ้าง ในด้านการทำงาน มีความรับผิดชอบในการทำงานดีครับ สำหรับบริษัทมาร์โคเวิลด์ ลาออกมานานแล้ว ตอนนี้ ยังออกทัวร์ให้กับ เจอนี่แลนด์อยู่ บางทีไม่จำเป็น ต้องทำทัวร์ต่างประเทศก็ได้ ตลอดสิบกว่าปีที่ผ่านมา อยากทำงานทัวร์ในประเทศดูบ้าง น่าสนใจดีเหมือนกัน ความสามารถพิเศษ แสดงโชว์ แต่งหญิง ร้องเพลงเสียงชาย เสียงหญิง ไทย สากล จีนได้ ความสามารถพวกนี้ไม่เคยได้ใช้กับเค้าบ้างเลย เลยรู้สึกเก็บกด อย่างแสดงออกบ้าง<br />\r\nอุปนิสัย เป็นคนตรง ดูเหมือนแรงๆ แต่ไม่มีอะไร ไม่เคยวีนลูกค้า ไม่เคยทำโดนคอมเพลน  อาจจะมีโอกาสได้ร่วมงานกัน ขอโอกาสนะครับ <br />\r\n0814888875 ติดต่อ หนุ่ม<br />\r\nnoomratat@gmail.com <br />\r\nLINE id 4888875 <br />\r\nfacebook= Noom Rata<br />\r\nnoomratat1920@gmail.com<br />\r\nโปรไฟล์ เกี่ยวกับการทำงาน พอมีอยู่บ้าง<br />\r\n<br />\r\n', 'นพดล', '089-777-5357', 'น้องชาย', '50', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ได้', '', 'ได้', '', 'ร้องเพลง แสดงโชว์ แต่งหน้า ', 'ร้องเพลง ช้อปปิ้ง ทำบุญ ขับรถอ', 'App_19114224019.jpg', '', '117.111.10.33', '2015-08-30 00:00:00'),
