	(266, 'ศรัญญา แพงวงค์', 'saranya pangwong', 'หญิง', '0000-00-00', 22, 70, 154, '0844691712', 'june_rw.60@hotmail.com', '', 0, 0, '', '3/1645 หมู่ 6 เดิม หมู่บ้านสงวนพัฒนา ถนนพหลโยธิน แขวงคลองถนน เขตสายไหม  กรุงเทพ', 'เมื่อปี่ที่แล้ว ได้ฝึกงานกับบริษัท เม็ดทรายทัวร์  ซึ่งเป็นบริษัทนำทัวร์ เกาะ  จะมีเกาะสิมิลัน เกาะตาชัย เกาะสุรินทร์  ก็ได้ใช้สิ่งต่าง ๆ ที่ได้เรียนมาในการฝึกงาน ในแต่ละวันเจอลูกค้าหลากหลายชาติ ในการลงเรือไปเกาะแต่ละวัน ก็จะลุย ๆ บางวันคลื่นแรง ก็จะต้องดูลูกค้าเป้นพิเศษเพราะลูกค้าจะเมาเรือ เราต้องคอยดูแลตลอด พอถึงจุดดำนำก็คอยใส่ชูชีพ จัดเตรียมน้ำ ขนม ผลไม้ ไว้ให้ลูกค้า  พอลงเกาะทานอาหารกลางวัน ก็ตักอาหารให้แกลูกค้า พาลูกค้าไปในจุดดท่องเที่ยวต่าง ๆ เช่น หินเรือใบ  เป้นต้นค่ะ', 'ร.ท. วีระพล แพงวงค์', '0850554979', 'บิดา', '', '', 'Mricrosoft Office', '', 'ดี', 'ดี', 'ดี', 'พอใช้', 'พอใช้', 'พอใช้', '', 'พอใช้', 'พอใช้', 'พอใช้', 'ได้', '', 'ได้', '', 'ร้องเพลง', 'อ่านหนังสือ  ฟังเพลง', 'App_15121412206.jpg', '', '171.7.187.62', '2015-08-30 00:00:00'),
