	(268, 'นาย ปิติพันธ์ ขำงาม', 'pitipun kumngam', 'ชาย', '0000-00-00', 24, 69, 170, '0858015013', 'pitipun1609@gmail.com', '', 0, 0, '', '    90/7 หมู่ 6 ตำบล ท่าทราย อำเภอ เมือง จังหวัดสมุทรสาคร  74000\r\n', 'ประสมการณ์ทัวร์ที่ผมเคยทำ จะมีทั้งแลนรี้ แล้วทัวร์ปรกติที่ขึ้นรถบัส <br />\r\nส่วนใหญ่จะเป็นทัวร์นำเที่ยว ในทัวร์นอกจากเที่ยวตามสถานที่ต่างๆแล้ว จะมีการจัดกิจกรรม เล่นเกมส์ ให้กับสมาชิก ให้บริการค่อยดูแลสมาชิก อำนวยความสะดวก และหน้าที่ของผมที่เคยทพอีกอย่างตือการถ่ายภาพ เก็บบรรยากาศ กิจกรรมระหว่างทริปทั้งหมด สิ่งผมจะทำทั้งหน้าที่หลักคือการถ่ายภาพ แล้วก็จะช่วยบริการอำนวยความสะดวกให้กับสมาชิกในตอนที่ไม่ต้องถ่ายภาพ', 'นางสาวเรณู ขำงาม', '0902768473', 'พี่สาว', '', '', 'Mricrosoft Office', 'Adobe Audion, Cool Edit Pro, Pro tool ', 'ดี', 'ดี', 'ดี', 'พอใช้', 'พอใช้', 'พอใช้', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'สามารถถ่ายภาพด้วยกล้อง DSLR ', 'ร้องเพลง', 'App_161214112821.jpg', 'pitipun kumngam.docx', '27.55.11.233', '2015-08-30 00:00:00'),
	(269, 'รวิศร์ลดา ปิยรัตนคุณากร', 'Rawizlada Piyarattanakunakorn', 'หญิง', '0000-00-00', 28, 54, 156, '0811312367', 'etel2nal@hotmail.com', '', 0, 0, '', '105-107 ถนนประชาธิปไตย แขวงบางขุนพรหม เขตพระนคร กทม 10200', 'ดิฉัน เรียนจบ คณะการท่องเที่ยวและการโรงแรม มา แต่ว่ายังไม่เคยมีประสบการณ์ในการทำทัวร์ตั้งแต่จบมา  แต่ประสบการณ์ที่เกี่ยวกับทัวร์ที่ดิฉันเคยผ่านมาก็มีการทริปทัวร์กันเองทั้งไปเที่ยวในประเทศและต่างประเทศ การไปเที่ยวต่างประเทศดิฉันจะจัดทริปประมาณ ปีละครั้ง ถึง2ครั้ง ซึ่งดิฉันเป็นคนจัดทริปเองทั้งหมด ทั้งหาสถานที่เที่ยวและศึกษาเส้นทางการเดินทางทั้งหมด รวมถึงการกำหนดค่าใช้จ่ายคร่าวๆในการเดินทางแต่ละครั้ง ซึ่งทริปของดิฉันส่วนใหญ่จะเป็นทริปค่อนข้างประหยัดแต่ต้องไม่กระทบถึงการท่องเที่ยวในครั้งนั้น', 'นางสาวอรุณี ปิยรัตนคุณากร', '0846601926', 'มารดา', '40', '30', 'Mricrosoft Office', 'Powerpoint', 'ดีมาก', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', '', 'พอใช้', 'พอใช้', 'พอใช้', 'ได้', '', 'ไม่ได้', '', '', 'ดูซีรีส์ , ฟังเพลง , เล่นInter', 'App_171214140121.jpg', 'Rawizlada Piyarattanakunakorn.', '171.97.57.84', '2015-08-30 00:00:00'),
