	(377, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี', 'น.ส.เดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '7', '3', 'Mricrosoft Office', 'Windows Movie Maker', 'ดี', 'ดีมาก', 'ดี', 'พอใช้', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ปฐมพยาบาลเบื้องต้น', 'ชอบท่องเที่ยวไปยังสถานที่ต่างๆ', 'App_12215171706.jpg', 'Thiachasa Nakpeenong.jpg', '171.96.179.100', '2015-08-30 00:00:00'),
	(378, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', 'App_12215173900.jpg', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(379, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', 'App_12215173919.jpg', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(380, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', '', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(381, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', 'App_12215174004.jpg', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(382, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', '', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(383, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', 'App_12215174037.jpg', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(384, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', '', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(385, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', '', '', '1.47.211.183', '2015-08-30 00:00:00'),
	(386, 'นางสาวฑิอชาสา นาคพี่น้อง', 'Thiachasa Nakpeenong', 'หญิง', '0000-00-00', 25, 44, 167, '0611839239', 'joyz6712@hotmail.com', '', 0, 0, '', '56/11 ม.1 ต.ศาลายา อ.พุทธมณฑล จ.นครปฐม 73770', 'ตอนเรียนปี1ฝึกงานบริษัททูริสโมเอเชีย(เกาะสมุย)<br />\r\nประสบการณ์ยกมา2เรื่องนะค่ะที่เจอปัญหาเกี่ยวกับนักท่องเที่ยวเรื่องราวค่อยข้งจะยาวหน่อยนะค่ะ<br />\r\n1. ปี3ฝึกงานบริษัททัวร์แห่งหนึ่ง.....(จ.อุดรธานี)ที่ไปฝึกจ.อุดรธานีเพราะอยากเรียนรู้วิถีชีวิตของคนภาคอีสานและอยากเรียนรู้วิถีการทำทัวร์แบบคนไทยเจอปัญหาหนักสุดตอนฝึกงานที่บริษัทแห่งนี้คือ วันนั้นจำได้ว่าเป็นกรุ๊ปทัวร์โรงพยาบาลกุมภาปี เดินทางจากอุดรธานีไปเกาะกูดจังหวัดตราดโปรแกรม5วัน4คืนภาคตะวันออก ออกเดินทางจากอุดรธานีตอน17.00น.รถทัวร์เสียที่โคราชกลางคืนตอนตี2และเปลี่ยนรถทัวร์คันใหม่ประมาณตี4และอยู่ๆรถทัวร์คันที่เปลี่ยนเสียอีกเปลี่ยนรถใหม่เป็นคันที่3ลูกทัวร์โว๊ยว้ายมากและจะไม่ไปต่อจะฟ้องบริษัทจะกลับอุดรธานี คือปัญหาเยอะมากในขนาดนั้นรถเสียอยู่แถวๆจันทบุรีตอนนั้นนั่งกันข้างถนนตั้งแต่เช้าประมาณ8โมงเช้านั่งกันกลางๆเขา ลูกทัวร์ทั้งหิวและเหนื่อยและเปลี่ยนรถมาคันที่3แล้วรถยังเสีย ระเบิดลงก็ว่าได้พี่ไกด์ที่บริษัทจ้างมาโทรหาผู้จัดการบริษัทว่าจะแก้ปัญหาอย่างไร คุยกันไม่นานผู้จัดการปิดเครื่องพี่สต๊าฟของบริษัทกับไกด์ติดต่อผู้จัดการไม่ได้อีกเลย ลูกทัวร์ต้องการให้บริษัทรับผิดชอบให้เอารถมารับกลับอุดรธานีไม่ก็ไปส่งลูกทัวร์ที่กรุงเทพ ผู้จัดการปิดเครื่องไม่เปิดอีกเลย พี่เขาที่เป็นไกด์กับสต๊าฟบริษัทบอกว่าจะไปหาร้านขายของชำเพื่อหาอะไรให้ลูกทัวร์กินก่อนเพราะใกล้จะเที่ยงแล้ว ให้เราอยู่กับลูกทัวร์คนเดียว ออกทัวร์รอบนั้นมี ไกด์1คนสต๊าฟบริษัท1คนและจอส์ยอีก1คนเป็น3คนดูแลลูกทัวร์ 50 คน ลูกทัวร์โวยวายจะกลับอย่างเดียว ตอนนั้นชักแม่น้ำทั้ง5มหาสมุทรกี่ที่ชักมาหมดเพื่อเกลียกล่อมให้ลูกทัวร์ไปต่อด้วยจรรยาบรรณที่เรียนมาและการฝึกอบรมในการเป็นมัคคุเทศก์ที่ดี เพื่อที่จะไม่ให้บริษัทโดนฟ้อง ด้วยที่เป็นนักศึกษาฝึกงานบริษัทดังกล่าวจอส์ยทำเต็มที พูดชักแม่น้ำทั้ง5 และมหาสมุทรทั้งหมดมาแล้วและหากิจกรรมให้ลูกทัวร์ทำขณะรอรถคันใหม่และรอพี่ๆจากไปซื้อของ เวลาผ่านไปประมาณ30นาทีทั้งผู้อำนวยการโรงพยาบาลกุมภาปีคุณหมอพยาบาลยอมไปต่อ จาก8โมงเช้าประมาณ13.30น.จึงจะมีรถอีกคันมรับ จอส์ยดีใจมากที่ทุกคนไปต่อและให้ทุกคนคิดว่าเราโชคดีได้นั่งรถตั้ง4 คัน มาทัวร์รอบนี้เกินคุ้มและพอไปถึงเกาะกูดจัดปาร์ตี้ให้ลูกทัวร์ก็สนุกสนานกันเต็มทีตลอดจนจบทริปนั้น พอกลับถึงจังหวัดอุดรธานีผู้อำนวยการโรงพยาบาลเรียกผู้จัดการไปพบและจะเอาผิดให้รับผิดชอบ แต่เห็นแก่ทีมงานที่ดูแลกรุ๊ปทัวร์อย่างดีแม้ว่าจะอย่ในสถานะการใดๆก็ตามครั้งนี้เลยไม่เอาโทษ ผู้จัดการกล่าวขอบคุณพี่ไกด์พี่สต๊าฟและจอส์ย ที่ช่วยให้บริษัทเขาไม่โดนฟ้อง ถือว่าเป็นประสบการณืที่ดีมากในครั้งนั้น และประทับใจทัวร์กรุ๊ปนั้นที่สุดที่ทำให้จอส์ยหาวิธีแก้ไขปัญหาเรื่องราวที่หนักๆมาได้<br />\r\n<br />\r\n2.และมีอีกเรื่องหนึ่งตอนทำงานเป็นไกด์ที่เกาะสมุย มีนักท่องเที่ยวชาวรัสเซียใช้บริการบริษัทที่จอส์ยทำงาน นักท่องเที่ยวมีปัญหากับโรงแรมเกี่ยวกับห้องพัก โรงแรมโทรมาให้บริษัทไปดูแลแขก ซึ่งตอนนั้นจอส์ยรับนักท่องเที่ยวอยู่ที่สนามบินและส่งออกแขกตั้งแต่เช้าด้วย อยู่ๆมีพนักงานที่อ๊อฟฟิตโทรมาให้เข้าไปที่อ๊อฟฟิตด่วน จอส์ยก็เข้าไป พี่เขาที่ทำโอเปให้จอส์ยไปดูนักท่องเที่ยวชาวรัสเซียที่โรงแรมอัมรีย์ให้หน่อย พี่เขาบอกว่าติดต่อแลปไม่ได้คือหน้าที่แลปที่จะต้องไปหาลูกทัวร์ พี่เขาให้ไปเราก็ไปแต่พี่เขาแค่บอกว่าแขกมีปัญหาเรื่องห้องพักแล้วให้เบอร์ไกด์ฟรีเล้นที่เป็นไกด์รัสเซียมา พอไปถึงนักเที่ยวมากัน4ท่านผู้ใหญ่1เด็ก3 แม่พาลูกมาเที่ยว พอพนักงานโรงแรมเห็นเราเดินไปใส่เสื้อบริษัทแค่นั้นและเหมือนเห็นสวรรค์ เราก็ งง พนักงานโรงแรมบอกว่าแขกมาถึงตั้งแต่9โมงเช้าแต่ไม่ยอมเข้าห้องพัก เพราะจองห้องวิลล่าชั้น2แต่ได้ห้องวิลล่าชั้น1 แขกเลยไม่ยอมเข้าพักตอนนั้นที่ไปถึงที่โรงแรม15.00น.พอแขกเห็นจอส์ยทำนั้นและแขกต่อว่าเราอย่างเดียวเลยพูดรัสเซียอย่างเดียวเลยเราก็ฟังไม่ค่อยรู้เรื่องก็ต่อสยไกด์รัสเซียให้พูด พอให้คุยกับไกด์รัสเซียนักท่องเที่ยวก็ว่าๆด่าว่าเขไกด์ตัดสายทิ้งและไม่รับอีกเลย ระหว่างนั้นก็เปิดอินเตอร์เน็ต หาสนทนาภาษารัสเซียเบื้องต้น เพราะต้องแก้ไขปัญหาเฉพาะหน้าให้ได้และต้องการให้นักท่องเที่ยวพึ่งพอใจด้วย ก็พูดสนทนารัสเซียกับนักท่องเที่ยวเบื้องต้นก็ไม่ไหวนักท่องเที่ยวไม่ยอมพูดอังกฤษเลย ตอนที่บุ๊คมาไม่ได้บุ๊คว่าจองไกด์รัสเซียด้วยแต่พอเกิดปัญหานักท่องเที่ยวไม่พูดอังกฤษเลยพูดแต่รัสเซีย คือพนักงานในโรงแรมไม่มีใครพูดรัสเซียได้และอีกอย่างนักท่องเที่ยวไม่ยอมเข้าห้องพักนั่งอยู่ที่ล็อบบี้ตั้งแต่เช้ายันบ่ายเด็กๆก็เริ่มเหนื่อยล่าไม่ไหว จอส์ยต่อสายไปกรุงเทพให้กรุงเทพต่อสายไปยังเอเจนซี่ที่นักท่องเที่ยวจองห้องพักจากประเทศรัสเซียพอคุยกันก็ไม่ตกลงกันได้ นักท่องเที่ยวไม่ยอมคุยต่อกับเอเจนซี่ที่ประเทศรัสเซีย จอส์ยเลยโทรหาพี่ทีรู้จักเขาเป็นไกด์รัสเซีย จอส์ยโทรหาเขาพูดถึงปัญหาให้ฟังพี่เขายินดีจะช่วย พอจอส์ยให้นักท่องเที่ยวคุยกับพี่ที่จอส์ยรู้จักนักท่องเที่ยวก็ด่าพี่เขาและโว้ยวายใส่พี่เขา และพี่เขาขอคุยกับจอส์ยเหตุการณ์ตอนนั้นทั้งนักท่องเที่ยวในโรงแรมและพนักงานมองกันเป็นตาเดียวพี่เขาก็เสียอรมณ์โดนด่าฟรี แต่พี่เขาก็ช่วยจอส์ยต่อ จอส์ยบอกพี่เขว่าถ้านักท่องเที่ยวไม่พอใจเปลี่ยนโรงแรมให้ก็ได้ จอส์ยให้พี่เขาคุยกับนักท่องเที่ยวอีกครั้งและนักท่องเที่ยวก็ตกลงพักโรงแรมเดิมห้องเดิมที่ได้ สาเหตุมาจากการสื่อสารในการจองห้องพักมาจากประเทศรัสเซียคือบุ๊คมจองห้องวิลล่าแต่ไม่ระบุว่าชั้นไหน นักท่องเที่ยวเลยไม่พึ่งพอใจ ปัญหาก็จบลงด้วยดีนักท่องเที่ยวเข้าพักตามห้องที่ได้ตอนบุ๊คมา ประสบการณ์รอบนี้ทำให้จอส์ยแก้ไขปัญหาให้กับนักท่องเที่ยวจนนักท่องเที่ยวพึ่งพอใจและแก้ไขปัญหาเฉพาะหน้าได้และจบลงด้วยดี<br />\r\n<br />\r\nหวังเป็นอย่างยิ่งว่าจะได้รับโอกาสดีดีจากทางบริษัท คอนเฟิร์มทัวร์ แอนด์ ทราเวิล จำกัด เข้าเป็นอีกคนหนึ่งในทีมงานนะค่ะ ขอบคุณค่ะ', 'นางสาวเดือนนภา นาคพี่น้อง', '092-8239846', 'พี่สาว', '8', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'ว่ายน้ำ,ปฐมพยาบาลเบื้องต้น', 'ท่องเที่ยวตามสถานที่ท่องเที่ยว', 'App_12215174143.jpg', 'Thiachasa Nakpeenong.jpg', '1.47.211.183', '2015-08-30 00:00:00'),
