	(390, 'เพ็ญพิชชา  ไชยมงคล', 'penpitcha chaimongkol', 'หญิง', '0000-00-00', 22, 49, 170, '0875105901', 'party.pizza384@gmail.com', '', 0, 0, '', '806/12 ถ.พหลโยธิน ต.คูคต อ.ลำลูกกา จ.ปทุมธานี 12130', 'เคยไดมีโอกาส ร่วมงานกับ ทีมคัลเลอฟูทัวร์ 2 ครั้ง รู้สึกติดใจและชอบมาก <br />\r\nกับการเป็นสตาร์ฟหรือมัคคุเทศน์ เพราะ<br />\r\n1. เราได้ใช้เวลาว่างในวันหยุดเสาร์อาทิตย์ได้เป็นประโยชน์และไม่เสียการเรียน <br />\r\n2. ส่วนตัวเป็นคนชอบงานบริการ และในอนาคตวางแผนไว้ว่าจะทำงานแนวนี้ งานนี้จึงเป็นประสบการที่มีค่ามากสำหรับตัวหนู<br />\r\n3. ชอบเวลาที่เราได้ทำให้ลูกค้ามีความสุข ได้ยิ้มและหัวเราะ และมีคำติชมตามมาตามผลงานการบริการของเรา<br />\r\n<br />\r\nอาจจะอ่อนประสบการงานด้านนี้ แต่พร้อมที่จะเรียนรู้ปรับปรุงและพัฒนาค่ะ', 'เบญจพล บุญภักดิ์', '0815595150', 'พี่ชาย', '', '', 'Mricrosoft Office', '', 'ดี', 'ดี', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ได้', '', 'ได้', '', 'เต้นทุกประเภท ', 'รับทำงาน Part time และธุรกิจส่', 'App_16215162746.jpg', '', '172.16.2.63', '2015-08-30 00:00:00'),
