	(474, 'นิศากร  โนนุช', 'Nisakon Nonuch', 'หญิง', '0000-00-00', 21, 43, 150, '0970012610', 'nisakon_nootuk@hotmail.com', '', 0, 0, '', '60 ถนนร่มเกล้า แขวงมีนบุรี เขตมีนบุรี กทม,10510', 'เคยไปออกทริปอยุธยา-พษณุโลก-ลพบุรี วัดมเหยงค์,วัดราชบูรณะ,วัดไชยวัฒนาราม,วัดพุทไธสวรรค์,วัดสุวรรณดาราม,พิพิธภัณฑ์เจ้าสามพระยา,วัดใหญ่ชัยมงคล,วัดมหาธาตุ,วัดพระศรีรัตนมหาธาตุ,นารายณ์ราชนิเวศน์,วัดหน้าพระเมรุ,พระราชวังบางประอินทร์,อุทยานประวัติศาสตร์อยุธยา,วัดพระศรีสรรเพชญ(พระราชวังเก่า),วิหารมงคลบพิตร<br />\r\n<br />\r\nสุโขทัย ศรีสัชนาลัย กำแพงเพชร<br />\r\nอุตทยานประวัติศาตร์สุโขทัย  อุทยานประวัติศาสตร์ศรีสัชนาลัย อุทยานประวัติศาสตร์กำแพงเพชรศรีสัชนาลัย กำแพงเพชร<br />\r\n<br />\r\nเพชรบุรี-นครปฐม<br />\r\nพระราชวังสนามจันทร์ พระราชวังมฤคทายวัน พระราชวังรามนิเวศน์ อุทยานประวัติศาสตร์พระนครคีรี<br />\r\n<br />\r\n- กาญจนบุรี นครปฐม ราชบุรี<br />\r\n(สะพานข้ามแม่น้ำแคว , พิพิธภัณฑ์อักษะ , อุทยานประวัติศาสตร์เมืองสิงห์,วัดพระปฐมเจดีย์, ตลาดน้ำดำเนินสะดวก)<br />\r\n<br />\r\nบุรีรัมย์ นครราชสีมา<br />\r\n(อุทยานประวัติศาสตร์เมืองต่ำ , อุทยานประวัติศาสตร์พนมรุ้ง , อุทยานประวัติศาสตร์พิมาย)<br />\r\n<br />\r\nราชบุรี<br />\r\n- ตลาดน้ำอัมพวา<br />\r\n- วัดขนอน (หนังใหญ่)', '', '0871325041', 'มารดา', '', '', 'Mricrosoft Office', '', 'ดี', 'ดี', 'ดี', 'พอใช้', 'พอใช้', 'พอใช้', '', 'พอใช้', 'พอใช้', 'พอใช้', 'ไม่ได้', '', 'ได้', '', 'เล่นกีฬา', 'อ่านหนังสือ ออกแบบของใช้', '', 'Nisakon Nonuch.jpg', '110.170.37.245', '2015-08-30 00:00:00'),
