	(539, 'น.ส.เสาวลักษณ์ คชารักษ์', 'SAOWALAK KHACHARAK', 'หญิง', '0000-00-00', 25, 48, 155, '0863924529', 'anoma_mu@hotmail.co.th', '', 0, 0, '', '353/249 ซอย 20 หมู่บ้านเดอะคอนเนค7/1 ถ.เทิดราชัน แขวงสีกัน เขตดอนเมือง 10210\r\n', '  ดิฉันเริ่มทำงานทัวร์มาตั้งแต่ปี2555 เริ่มด้วยการเป็นสตาฟให้กับบริษัทแห่งหนึ่งที่เมืองทอง 3 เดือนต่อมาก็ได้โอกาสจากพี่คนนึงให้ลองทำงานไกด์ ต่อมาก็เป็นสตาฟบ้าง ไกด์บ้างแล้วแต่โอกาสที่ได้รับ ปัจจุบันรับงานเป็นมัคคุเทศก์อิสระให้กับบริษัทในกรุงเทพฯและต่างจังหวัด <br />\r\n  หน้าที่  คอยต้อนรับลูกค้า ให้บริการตลอดเส้นทางที่เดินทางในแต่ละทริป ให้ข้อมูลบนรถ อินเตอร์เทรนลูกค้า นำชมสถานที่ เป็นพิธีกรบ้าง จัดกิจกรรมชายหาด ฯลฯ<br />\r\n   ปัญหาที่เกิดระหว่างการทำงาน มีบ้างทุกกรุ๊ปแตกต่างกันไป เช่นที่โรงแรม ร้านอาหาร รวมทั้งความต้องการของลูกค้าที่มากเกิน ปัญหาที่เกิดจากโปรแกรมทัวร์ ปัญเรื่องการวางเงินมัดจำ  แต่ทั้งนี้ทั้งนั้นก็สามารถพูดคุยและได้ผลเป็นที่น่าพอใจทั้งสองฝ่าย บวกกับทีมงานที่ไปด้วยกันมีความสามารถในการแก้ไขสถานะการเฉพาะหน้าได้เป็นอย่างดี จึงทำให้การทำงานผ่านไปได้ด้วยดีค่ะ<br />\r\n  *หวังเป็นอย่างยิ่งว่าจะได้มีโอกาสร่วมงานกับทางบริษัทของท่าน', '0819672945', '', 'คุณน้า', '35', '25', 'Mricrosoft Office', '', 'ดี', 'ดี', 'ดี', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', 'รำนาฏศิลป์', 'ดุหนัง ฟังเพลง หาเกร็ดความรู้+', '', 'SAOWALAK KHACHARAK.jpg', '124.122.43.245', '2015-08-30 00:00:00'),
