	(598, 'พรทิพย์ บุญทองโท', 'Phornthip Bunthongto', 'หญิง', '0000-00-00', 24, 52, 160, '0829578581', 'Phornthipb@outlook.com', '', 0, 0, '', '143/1 หมุ่2 ต.รังสิต อ.ธัญบุรี จ.ปทุมธานี 12110', 'สวัสดีค้ะ ดิชั้น เรียนด้านไกด์มาโดยตรง มีบัตรไกดฺ<br />\r\nได้เริ่มจากการเป้นสตาฟ มาหลายครั้ง จนเริ่มเป้นไกด์<br />\r\nของกลุ่มนักเรียน โรงงาน และกลุ่มบริษัท<br />\r\nโดยรับเป้น ฟรีแลนซ์ หลักๆรับงานจาก บ.โกลเด้น7สตาร<br />\r\nถ้าไปเที่ยวไม่นับการเป้นสตาฟ หรือไกด์ ก้ขึ้นเหลือล่องใต้มาหลาก<br />\r\nหลายที่ เพราะตัวเองเป้นคนชอบแบ้คแพ้คยุ่แล้ว <br />\r\nแต่ถ้าทำงาน ที่ไปบ่อยๆก้โซน <br />\r\nชลบุรี ระยอง ตราด หัวหิน เพชรบุรี เขาใหญ่ กาญจนบุรี นครนายก ปราจีนบุรี<br />\r\nดิชั้นเรียนด้านนี้มาโดยตรง รับรองเรื่องการบริการและการเอ้นเตอรเทรนคะ', 'ตุนเกรียงไกร', '0917256524', 'เพื่อน', '30', '', '', 'Internet', 'ดีมาก', 'ดีมาก', 'ดีมาก', 'พอใช้', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ได้', '', 'ได้', '', 'เต้น ร้อง กีฬา', 'ฟิตเนส รับงานฟรีแลนซ์', 'App_7515171510.jpg', '', '27.55.37.138', '2015-08-30 00:00:00'),
