	(673, 'สุรชัย  บุญจง', 'SURACHAI BOONJONG', 'ชาย', '0000-00-00', 20, 77, 178, '061-8240454', 's.chai.architect@hotmail.com', '', 0, 0, '', '119/715 ม.1 หมู่บ้านเรือนสุข 1 ซอย 61 ต.ลำผักกูด อ.ธัญบุรี จ.ปทุมธานี 12110', 'ปี 2 มีการจัดทำบริษัททัวร์จำลองไปทริปกาญจนบุรีเมีการแบ่งกลุ่มทำงาน โดยที่เราต้องจัดการ ประสานงานกับโรงแรม สถานที่ท่องเที่ยว และเป็นมัคคุเทศก์เอง ดดยมีเพื่อนเป้นลูกทัวร์<br />\r\nเคยฝึกงานที่บริษัท เดสทิเนชั่น เอเชีย (ประเทศไทย) เป็นบริษัทแบบInbound ได้ทำงานทั้งในแผนก Operator และ Reservation แล้วยังได้มีการติดตามทัวร์ทุกสัปดาห์เช่น ทัวร์วัดวังในกรุงเทพฯ ทัวร์อยุธยา By Cruise  ทัวร์กาญจนื วัดเสือ ทัวร์ดำเนินสะดวก ราชบุรี เป็นต้น<br />\r\nปี 3 ได้มีวิชาฝึกงาน2 ที่ต้องจัดทำบริษัททัวร์จำลอง โดยเราต้องประสานงานกับบริษัททัวร์ติดต่อสอบถามแพ็คเกจราคา เพื่อที่เราจะนำมาดำเนินการประชาสัมพันธื ดปรโมทขายเอง และเราก็ต้องทำหน้าที่เสมือนเป็นหัวหน้าทัวร์ดูแลลูกทัวร์ตลอดการเดินทาง โดยครั้งนี้ทำแพ็คเกจไปเที่ยวพม่า ย่างกุ้ง หงสา 3วัน2คืน<br />\r\nและมีการศึกษาดูงานการทำทัวร์ไปเวียตนามกลาง เว้ ดานัง ฮอยอัน 5วัน3คืน <br />\r\n', 'นางศจี  บุญจง', '084-1666197', 'มารดา', '40', '30', 'Mricrosoft Office', 'After Effect , Movie Maker', 'ดีมาก', 'ดี', 'ดี', 'พอใช้', 'ดี', 'พอใช้', '', 'พอใช้', 'พอใช้', 'พอใช้', 'ไม่ได้', '', 'ได้', '', 'ร้องเพลง วาดภาพ', 'ดูรีวิวสถานที่ต่างๆ สนใจในสถาป', 'App_22515131028.jpg', 'SURACHAI BOONJONG.pdf', '171.97.170.229', '2015-08-30 00:00:00'),
