	(737, 'พรรณี อุ่นคำ', 'Pannee Aoonkum', 'หญิง', '0000-00-00', 27, 44, 165, '0906680800', 'aoonkum.p@gmail.com', '', 0, 0, '', 'Ideo Mix Sukhumvit 103 เลขที่ 9 ซอยอุดมสุข 3 \r\nแขวงบางนา เขตบางนา กรุงเทพฯ 10260', 'ไม่เคยทำงานทางทัวร์ ด้านท่องเที่ยวมากก่อนแต่เรียนจบทางด้านการโรงแรม และเป็นคนที่ชอบเที่ยวอยากไปที่ไหนก็จะหาข้อมูลจากเว็บต่างๆ และก็ในพันทิป<br />\r\nและล่าสุดที่ได้ไปเที่ยวทะเลตรังได้ใช้บริการทัวร์ท่องเที่ยวของ เกาะมุกชาวเลตรังทัวร์ เป็นครั้งแรกที่ได้ไปเที่ยวทะเลฝั่งอันดามัน และได้ใช้บริการทัวร์ครั้งแรก ระยะเวลาตลอด 2คืน 3วัน เป็นอะไรที่ประทับใจมาก ข้อแยกเป็นข้อค่ะ<br />\r\n1. เที่ยวถ้ามรกต คนนำทัวร์เค้าถามพวกเราว่าหิวข้าวรึยัง ทนไหวไวกินเรทเที่ยงได้รึเปล่า เพราะจะพาเข้าถ้ามรกตแบบส่วนตัวตอนแรกก็งงๆกันเพราะเคยเห็นรูปในเน็ตคนจะเยอะมา พวกเราก็ยังไม่ค่อยหิว สรุปไกด์พาไปที่ถ้ำมีเรือทัวร์ประมาณ 4-5 ลำจอดรอหน้าถ้ำ ได้ยินเสียงคนดังมากมาจากด้านใน รอนานอยู่บนเรือประมาณ 40นาทีได้ทัวร์ทยอนออกและขึ้นเรือจนหมดพี่ไกด์ก็พาเราเข้าถ้าซึ่งในถ้าไม่มีใครเลย เหมือนทั้งถ้ำปอดจองแค่เราแต่ละหร่างที่เรากำลังออกมีเรือทัวร์กำลังมาอีกประมาณ 2-3ลำได้ คิดในใจโชคดีมากเลย<br />\r\n2. ตลอดเวลาที่ไปดำน้ำดูประการัง ตัวเองเป็นว่ายน้ำไม่เป็นพี่ไกด์ก็จะเป็นคนลากได้ ดำไปเอาประการังมาให้เราถ่ายรูปคู่ หรือดำลงไปชี้ให้เราดูว่าเห็นปลานี่มั้ย พี่ไกด์ดูแลและเป็นกันเองมาก <br />\r\n3. วันสุดท้ายที่กลับขึ้นฝั่งเพราะพักันที่เกาะมุก จองตั๋วไฟล์กลับไว้ตอน 6โมงเย็นมีเวลาเกือบทั้งวันพี่ไกด์ก็เลยแนะนำว่าออกเช้าหน่อยเี๋ยวพี่เค้าพาขับรถที่จะใช้ไปส่งเราที่สนามบินพาไปเที่ยวเมืองตรังก่อน จะได้รู้ว่าเมืองตรังไม่ได้มีดีแค่ทะเล พี่ไกด์พาไปสถานที่ต่างๆประมาณ 5-6ที่ได้ เช่นเจ้าเมืองของตรังซึ่งจำชื่อไม่ได้แล้ว ไปดูต้นยางพาราต้นแรก ไแแช่เท้าที่บ่อน้ำพุร้อน ไปด้วยต้นไม้หอมเทพธาโร  ไปกินติ๋มซำขึ้นชื่อ เดินซื้อของฝากบอกต้องร้านนี้อันนี้อร่อย ร้านนี้อันดี ทั้งๆที่พี่ำกด์เค้าไม่ได้ส่วนแบ่งหรือรู้จักกับร้านของฝากเลย <br />\r\n<br />\r\nขอยกตัวอย่างประสบการ์ณครั้งแรกของการไปเที่ยวที่ไกลกว่าหัวหิน ครั้งแรกกับทะเลอันดามัน และครั้งแรกกับการใช้บริการทัวร์ 2คืน 3วัน ', 'ไพจิตร์ อุ่นคำ', '0871149915', 'มารดา', '25', '20', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดีมาก', 'พอใช้', 'พอใช้', 'พอใช้', '', 'พูด', 'อ่าน', 'เขียน', 'ได้', '', 'ไม่ได้', '', '', 'เล่นอินเตอร์เน็ตหาที่เที่ยว ว่', 'App_6615190452.jpg', '', '125.25.191.65', '2015-08-30 00:00:00'),
