	(788, 'อรจิรา วันไธสง', 'onjira wanthaisong', 'หญิง', '0000-00-00', 21, 48, 153, '093-6703575', 'kat.010238@gmail.com', '', 0, 0, '', '108/9 หมู่ 10 ซอยหมู่บ้านสินสมบูรณ์ พีเอ็นแมนชั่น ต.อ้อมน้อย อ.กระทุ่มแบน จ.สมุทรสาคร 74130', 'ได้จัดรายการทัวร์ สร้างบริษัททัวร์จำลองของมหาวิทยาลัย และเดินทางตามรายการทัวร์ที่กำหนด โดยจะมีการแบ่งกลุ่มในสาขาการท่องเที่ยวตามชั้นปี และแบ่งหน้าที่กัน แผนกจองโรงแรม มัคคุเทศก์ สตาฟ และฝ่ายจัดหารถ ฯลฯ กำหนดวันเวลาออกเดินทาง และกำหนดราคาทัวร์ของลูกค้าแต่ละคน ทัวร์จำลองอิสานใต้ นครราชสีมา บุรีรัมย์ 2วัน 1คืน และทัวร์จำลอง ทริป สมุทรสงคราม - ราชบุรี - กาญจนบุรี - นครปฐม 2คืน3วัน โดยทุกทริป จะมีการจัดงานแสดงตอนกลางคืนและจัดตรีมงานตามสถานที่หรือเกี่ยวข้องกับที่ท้องเที่ยวที่เราไป และมีกิจกรรมร้องเพลงการแสดงต่างๆที่จัดขึ้นเองทั้งหมดของนักเรียนสาขาการท่องเที่ยวในชั้นปีที่ไป ทัวร์ในกรุงเทพ พระบรมมหาราชวัง วัดพระแก้ว และสถานที่สำคัญต่างๆในกรุงเทพ โดยการเดินทาง One Day Trip ไปเช้าเย็นกลับ โดยมีมัคคุเทศก์คอยบรรยายสถานที่ต่างๆให้ฟังและเป็นขั้นพื้นฐาน เก็บเกี่ยวความรู้ ศึกษาการทำงานของมัคคุเทศก์ และการพูดบนรถให้ลูกทัวร์ฟัง ', '088-893-1736', '', 'พ่อ', '', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดีมาก', 'ดี', 'ดี', 'ดี', '', 'พูด', 'อ่าน', 'เขียน', 'ได้', '', 'ได้', '', ' การกล้าแสดงออกต่างๆ   มีมนุษยสัมพันธ์ดี -  สนใจและเล่นกีฬา ', 'ดูรายการท่องเที่ยว สารคดีต่างๆ', '', '', '27.130.77.227', '2015-08-30 00:00:00'),
