	(829, 'น.ส.ฟาง  โพนสนัด', 'fang ponsanat', 'หญิง', '0000-00-00', 20, 46, 160, '0848722757', 'fang13608-za@hotmail.com', '', 0, 0, '', '167 ซ.ประชาอุทิศ 15 แขวง/เขต ราษฎร์บูรณะ กรุงเทพฯ 10140', 'ดิฉันเคยเป็นสตาปทัวร์ที่เกาะช้างค่ะ<br />\r\nทัวร์ส่วนใหญ่จะเป็นคนไทย มาจากภาคเหนือบ้าง ภาคกลางบ้าง<br />\r\nงานส่วนใหญ่ก็จะเป็นการบริการเริ่มจากรับลูกทัวร์ที่มาจากจังหวัดต่างๆ เชิญให้เข้ามารับทานอาหาร เราก็คอยเสริฟข้าวเสริฟน้ำให้ลูกทัวร์ และพอลูกทัวร์ทานข้าวเสร็จก็พาขึ้นเรือเฟอร์รี่ เพื่อข้ามไปยังเกาะช้าง <br />\r\nพอถึงเกาะก็เช็คจำนวนลูกค้า และพาส่งที่พัก รอสแตนบาย อยู่ที่หน้าฟรอน รอเผือลูกค้าจะมีปัญหาอะไรเกี่ยวกับห้องพักหรือเปล่า และพอตกเย็นก็พาลูกทัวร์ไปทานข้าว ดูหิ่งห้อย พาไปจุดชมวิว<br />\r\nและนำลูกทัวร์กลับมาส่งที่ห้องพัก<br />\r\nเช้าวันต่อมาก็พาไปดำน้ำดูปาการัง เราก็มีหน้าที่คอยดูแลลูกค้า คอยบอกและช่วยใส่ชุดชูชีพ สน๊อคเกิ้นและ แว่นตา ค่ะ พาไปดูหมู่เกาะต่างๆ เสร็จแล้วเราก็คอยเสริมน้ำ และอาหารเป็นพักๆ ตกเย็นกลับห้องพักและจัดเตรียมปารตี้ให้กับลูกค้าค่ะ <br />\r\nและวันรุ้งขึ้นก็ส่งลูกค้าขึ้นเรือและพากลับไปยังบนฝั่งอีกครั้งหน่งค่ะ <br />\r\n', '', '', '', '', '', 'Mricrosoft Office', '', 'ดีมาก', 'ดีมาก', 'ดีมาก', 'พอใช้', 'พอใช้', 'พอใช้', '', 'พูด', 'อ่าน', 'เขียน', 'ไม่ได้', '', 'ได้', '', '', 'วาดรูป,ร้องเพลง', 'App_7715162849.jpg', '', '58.11.194.162', '2015-08-30 00:00:00'),
